AndroZip File Manager helps you copy, delete, move, search, and organize your files, music, pictures, and folders just like you would do on your PC.
With over 4 million downloads and its support of ZIP, encrypted ZIP, RAR, TAR, GZIP, BZIP2, and 7ZIP archive formats, AndroZip File Manager is definitive leader among similar applications on the market.

Besides the archive functionality it also lets you send files, e.g. via email.

Optimized specifically for both, phone and tablet displays. Due to many added features like drag and drop functionality, AndroZip File Manager is preferred among tablet users.

Use it also to back up your applications and install new application APK on your phone, and manage phone memory and resources via task manager.

Installs to SD card.

Features:

    Work with archives: ZIP, RAR, 7ZIP (BETA - under development) , GZIP, TAR, BZIP2 
    Create ZIP,TAR,GZIP 
    File manager (single/multiple) 
    Task killer, Search, application manager 
    Install apps: APK files 
    Short tap and long tap menus 
    Send files via mail 

What's in this version: (Updated : Jan 27, 2013)

    Dropbox integration

Required Android O/S : 2.0+

